    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 * + col0 <> ( NULL ) OR - cor0.col0 * - col0 * + col0 NOT IN ( col0 + + col1 );
  - name: tab2

outputs:
